import React from 'react';

export const CareerGoal = () => {
    const styles = {
        container: {
            padding: '150px',
            fontSize: '24px',
            lineHeight: '1.5',
            textAlign: 'center',
        },
        heading: {
            fontSize: '36px',
            marginBottom: '30px',
        },
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.heading}>Career Goal</h2>
            <p>
                Based on the information provided, it appears that Onur Korkmaz has a
                strong background in computer science with a focus on web and software
                development. He has experience with a variety of programming languages
                including Java, C#, PHP, and JavaScript, as well as with various design
                principles and methodologies such as OOP, MVC, and Agile.
            </p>
            <p>
                In terms of career goals, Onur may be interested in pursuing a role as a
                software developer, web developer, or full-stack developer. He has
                demonstrated experience working on a variety of projects, from building
                web applications to designing and implementing CRUD systems.
                Additionally, his experience with both front-end and back-end
                development, as well as his proficiency in various programming
                languages, may make him a valuable asset to a development team.
            </p>
            <p>
                Onur may also be interested in pursuing further education or
                certifications in computer science or related fields to further enhance
                his skills and knowledge. Additionally, he may consider contributing to
                open-source projects or participating in hackathons or other coding
                events to build his portfolio and network with other developers.
            </p>
        </div>
    );
};
